    data: |
      SELECT DISTINCT - col1 / - 3 + 85 + + + 30 * + + 25 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT 53 * + col2 BETWEEN 10 AND + - 2 - col1;
  - name: tab2

outputs:
  - name: q13692.out
    data: |
      852
      857
      860
